export const tms = (
  myInfo,
  setMyInfo,
  posInArr,
  setPosInArr,
  isIncreasing,
  setIsIncreasing,
  arrElement,
  setArrElement,
  isTimeoutCleared,
  setIsTimeoutCleared,
  seconds
) => {
  let timeout;
  if (isIncreasing) {
    timeout = setTimeout(() => {
      if (isIncreasing) {
        setMyInfo(myInfo + arr[arrElement][posInArr]);
        setPosInArr(posInArr + 1);
        if (posInArr == arr[arrElement].length - 1) {
          setIsIncreasing(false);
          clearTimeout(timeout);
          setIsTimeoutCleared(true);
          setTimeout(() => {
            setIsTimeoutCleared(false);
          }, 1000);

          return;
        }
      } else {
        setMyInfo(myInfo.slice(0, posInArr - 1));
        setPosInArr(posInArr - 1);
        if (posInArr == 1) {
          if (arrElement + 1 < arr.length) {
            setArrElement(arrElement + 1);
          } else {
            setArrElement(0);
          }
          setIsIncreasing(true);
        }
      }
    }, 190);
  } else {
    timeout = setTimeout(() => {
      if (isIncreasing) {
        setMyInfo(myInfo + arr[arrElement][posInArr]);
        setPosInArr(posInArr + 1);
        if (posInArr == arr[arrElement].length - 1) {
          setIsIncreasing(false);
          clearTimeout(timeout);
          setIsTimeoutCleared(true);
          setTimeout(() => {
            setIsTimeoutCleared(false);
          }, 1000);

          return;
        }
      } else {
        setMyInfo(myInfo.slice(0, posInArr - 1));
        setPosInArr(posInArr - 1);
        if (posInArr == 1) {
          if (arrElement + 1 < arr.length) {
            setArrElement(arrElement + 1);
          } else {
            setArrElement(0);
          }
          setIsIncreasing(true);
        }
      }
    }, 80);
  }

  return () => {
    clearTimeout(timeout);
  };
};

